🌸ざっくり印刷方法🌸
セブンイレブンに行きます→コピー機に向かいます→ネットプリントのボタンがあるはずなので押します→L版印刷かポストカード印刷を選択→プリントしたい絵柄の番号入力→料金入れる→印刷完了
